import { NavLink, Outlet } from 'react-router-dom'


function Layout() {
    return (
        <>
    <header>
        <div>
          <NavLink to="/">Home</NavLink>
          <NavLink to="/login">LoginPage</NavLink>
        </div>
    </header>
    <Outlet />
    </>
    );
  }
  
  export {Layout};
